  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Eastern
  Shore of Virginia National Wildlife Refuge outlines Refuge accomplishments during
  the 1991 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the management plan, public participation, compliance with
  environmental and cultural resource mandates, and research and investigations. Refuge
  administration is outlined; information about personnel, youth programs, other manpower
  programs, volunteer programs, funding, and safety is given. Habitat management is
  also covered; subjects include wetlands, forests, croplands, grasslands, fire management,
  and pest control. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, other migratory birds, game mammals, marine mammals, other resident wildlife,
  scientific collections, animal control, marking and bird banding, and disease prevention
  and control. The public uses of the Refuge described in this report include interpretive
  programs, outdoor classrooms, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment utilization and replacement, and communication systems.
  Cooperative programs  and items of interest are provided at the end. Refuge brochures
  and field guides are attached. A brief narrative report on Fisherman Island National
  Wildlife Refuge is also included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
